Cần cho thuê căn hộ tòa 17T8 Hoàng Đạo Thúy.<br>- Căn góc diện tích: 120m².<br>3 phòng ngủ rộng rãi, 1 phòng khách
- khu bếp đầy đủ tiện nghi.<br>2 nhà vệ sinh sạch sẽ.<br>- Căn hộ được trang bị đầy đủ đồ đạc (tivi, tủ lạnh, máy giặt, giường tủ quần áo...
), bạn chỉ cần xách vali đến ở.<br>Giá 17.5 triệu/tháng.<br>Liên hệ xem nhà: Em Linh .<br><br>Gần nhiều trường học: Lý Thái Tổ, Tiểu học Ngôi sao, Mầm non Hoa Trà My, Amsterdam.
